export const homeObjOne = {
    id: 'search1',
    lightBg: false,
    lightText: true,
    lightTextDesc: true,
    topLine: 'Premium Bank',
    headline: 'Search',
    description: 'ค้นหาจำนวนแคลอรี่และข้อมูลทางโภชนาการ หรือจำนวนแคลอรี่ที่ลดลงไปของกิจกรรมที่ทำ',
    buttonLabel1: 'Get started',
    imgStart: false,
    img: require('../../images/svg-1.svg').default,    
    alt: 'Car',
    dark: true,
    primary: true,
    darkText: false
}

export const homeObjTwo = {
    id: 'calculator1',
    lightBg: true,
    lightText: false,
    lightTextDesc: false,
    topLine: 'Unlimited Access',
    headline: 'Calculator',
    description: 'คำนวณหาแคลอรี่ที่เหมาะสมกับตัวคุณโดยเฉพาะหากต้องการลดหรือเพิ่มน้ำหนัก เราด็สามารถคำนวณให้ได้!',
    buttonLabel2: 'Learn More',
    imgStart: true,
    img: require('../../images/svg-2.svg').default,    
    alt: 'Piggybank',
    dark: false,
    primary: false,
    darkText: true
}

